window.bookSummaryJSON = "<p>In a world of magic, an outcast elf with none might be the only one who can save the world...unless he brings about its destruction first.</p> <p><b>An epic fantasy that spans three realms from K. L. Reinhart </b></p> <p>Terak is an orphaned elf who has been raised by the severe order of monks known as the Enclave. Inside the walls of the Black Keep, he is an outcast in more ways than one. In a world of magic, he must learn how to survive with no magic of his own. Can the very thing that makes him despised save those that would rather he didn't exist at all?</p> <p><i>The Battle Born Omnibus</i> contains the first three stories in the Dagger of the World epic fantasy series where an outcast elf with no magic will be called on to save the world.</p> <p>Download the <i>Battle Born Omnibus</i> and get started on your next epic adventure today!</p>"; 
